import React from "react";
import Lodging from "../../pages/lodging"
import "../../data/lodging.json"

function Tags() {
    const [lodging] = useState(null);
    const tags = lodging.tags.map((element, index) => (
        <p className='tagLodging' key={"tagsLodg-" + index}> {element}</p>
      ))

    return (
      <div className="TagsElement">
           <p className='tags'>{lodging.tags}</p>
      </div>
    );
  }

  export default Tags;
